import React from 'react';
import ReactDOM from 'react-dom/client';
import Dashboard from './dashboard'; // নিশ্চিত করুন এখানে ফাইলের নাম সঠিক
import App from './App'; // যদি আপনার App.js থাকে
import './index.css'; // যদি আপনার CSS ফাইল থাকে

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Dashboard /> {/* আপনার Dashboard কম্পোনেন্ট এখানে রেন্ডার হচ্ছে */}
  </React.StrictMode>
);
